import React from 'react';
import Navbar from './Navbar';
import Form from './Form';


const App = () =>{
    return (
        <>
        <Navbar/>
        <h1>Harsh Bhatnagar is great</h1>
        <div className="container">
            <Form/>
        </div>
        </>
    );
}

export default App;
